
public class Coordinate {
	private int x;
	private int y;
	
	
	public Coordinate() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Coordinate(int x, int y) {
		super();
		this.x = x;
		this.y = y;
	}
	public void setX(int x) {
		this.x = x;
	}
	public int getX() {
		return x;
	}
	public void setY(int y) {
		this.y = y;
	}
	public int getY() {
		return y;
	}
	

}
